  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108075 includes discrete
  sample and profile data collected from ROGER REVELLE in the Indian Ocean from 2009-03-20
  to 2009-05-15. These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON (DIC), DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE,
  NEON, NITRATE, NITRITE, Potential temperature (theta), SALINITY, SULFUR HEXAFLUORIDE
  (SF6), TOTAL ALKALINITY (TA), Total Dissolved Nitrogen (TDN), Tritium (Hydrogen
  isotope), WATER TEMPERATURE, pH, phosphate and silicate. The instruments used to
  collect these data include Alkalinity titrator, CTD, Coulometer for DIC measurement,
  bottle and spectrophotometer.nnThese data were collected by Dennis Hansell of Rosenstiel
  School of Marine and Atmospheric Science, Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic
  Oceanographic and Meteorological Laboratory, Richard A. Feely of US DOC; NOAA; OAR;
  Pacific Marine Environmental Laboratory and Andrew Dickson of University of California
  - San Diego; Scripps Institution of Oceanography as part of the CLIVAR_I05_2009
  data set. CDIAC associated the following cruise ID(s) with this data set: CLIVAR_I05_2009nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
